import styled from "styled-components";

const Contact = () => {
  const Wrapper = styled.section`
    padding: 9rem 0 5rem 0;
    text-align: center;

    .container {
      margin-top: 6rem;

      .contact-form {
        max-width: 50rem;
        margin: auto;

        .contact-inputs {
          display: flex;
          flex-direction: column;
          gap: 3rem;

          input[type="submit"] {
            cursor: pointer;
            transition: all 0.2s;

            &:hover {
              background-color: ${({ theme }) => theme.colors.white};
              border: 1px solid ${({ theme }) => theme.colors.btn};
              color: ${({ theme }) => theme.colors.btn};
              transform: scale(0.9);
            }
          }
        }
      }
    }
  `;

  return (
    <Wrapper>
    <h2 className="comman-heading">contact page</h2>
    <iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d14414.128318752539!2d78.59629023145612!3d25
.42046902142655!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3977777747cef93b%3A0xdb98224d8306db90!
            2sBhatta%20Gaon%2C%20Jhansi%2C%20Uttar%20Pradesh!5e0!3m2!1sen!2sin!4v1707327354818!5m2!1sen!2sin"
      width="100%"
      height="400"
      style={{ border: 0 }}
      allowfullscreen=""
      loading="lazy"
      referrerPolicy="no-referrer-when-downgrade"></iframe>


    <div className="container">
      <div className="contact-form">
        <form action="https://formspree.io/f/mdoqeybb" method="POST" className="contact-inputs">
          <input type="text"
            placeholder="username"
            name="username"
            required
            autoComplete="off"

          />

          <input className="email"
            name="Email"
            placeholder="Enter Your Email"
            autoComplete="off"
            required

          />
          <textarea name="Messages" 
          cols="30" 
          rows="10"
          placeholder="Enter Your Message" 
          required 
          autoComplete="off">

          </textarea>

<input type="submit" value="send"></input>





        </form>
      </div>
    </div>


  </Wrapper>
  );
};

export default Contact;
